import React from "react";
import { NavLink } from "react-router-dom";

function SearchPage() {
  return (
    <div>
      <h1>Search</h1>
      <p>This is the search page</p>
      <NavLink to="/">Landing</NavLink>
    </div>
  );
}

export default SearchPage;
